    render() {
        return (
            <div>
                <Typography variant="h1" gutterBottom>
                    {this.props.title}
                </Typography>
                <Typography variant="h3" gutterBottom>
                    {this.props.writter}
                </Typography>
                <Typography variant="h5" >
                    {this.props.content}
                </Typography>
            </div>
        )
    }

}

